import React, { Component } from 'react';
import SpeciesItem from '../components/SpeciesItem.js'

class SpeciesData extends Component {
  render(){
    return(
      <div>
          this is the species item container
        <SpeciesItem />
      </div>
    )
  }
}

export default SpeciesData
